(141, 'dd7298aa1a5d2220ba3b11d82db4feb9a3bc908e', '114.125.124.240', '114.125.124.240', NULL, 'listInformasi', '{\"signature\":\"dd7298aa1a5d2220ba3b11d82db4feb9a3bc908e\"}', '{\"greeting\":\"Welcome\",\"pic\":\"Astrinda\",\"server_time\":\"19-08-2018 16:42:19\",\"status\":200,\"status_desc\":\"OK\",\"results\":{\"status_request\":\"OK\",\"msg\":\"Berhasil\",\"data\":[{\"idInformasi\":\"1\",\"namaPenyakit\":\"Skizofrenia\",\"content\":\"Kondisi skizofrenia merupakan jenis gangguan otak yang mempengaruhi cara seseorang berkelakuan, berpikir dan melihat sekelilingnya. Hal yang paling menonjol dari seorang penderita skizofrenia adalah adanya pandangan yang tidak pasti mengenai kenyataan, sehingga terdapat kecenderungan penderita skizofrenia yang dapat berhalusinasi, berbicara dengan cara bicara yang aneh dan membingungkan, paranoid jika orang lain sedang berusaha melukai dirinya hingga merasa dirinya sedang diawasi.\",\"created_at\":\"2018-07-12 11:38:06\"},{\"idInformasi\":\"2\",\"namaPenyakit\":\"Gangguan Cemas\",\"content\":\"Kondisi psikis ini tak mengenal golongan, siapa saja bisa kena gangguan cemas. Gejala yang mungkin Anda rasakan antara lain selalu merasakan kecemasan terhadap hal-hal yang kecil sekalipun. Kecemasan ini tak hilang meski sudah berbulan-bulan. Perasaan tersebut disertai dengan perubahan fisik yang cukup kentara, misalnya badan lemas, nyeri otot, atau gangguan pencernaan. Perubahan perilaku juga bisa diamati, contohnya menarik diri dari lingkungan sosial dan susah tidur. Tak jarang orang yang menderita gangguan psikis ini tiba-tiba mengingat kembali trauma atau kenangan buruk yang pernah terjadi. Baik itu kejadian baru-baru ini atau bertahun-tahun lalu.\",\"created_at\":\"2018-07-12 11:41:01\"},{\"idInformasi\":\"3\",\"namaPenyakit\":\"Depresi\",\"content\":\"Depresi masuk ke dalam kategori gangguan psikologi yang memiliki pengaruh cukup besar pada aktivitas seseorang yang menderitanya dalam kehidupan sehari hari. Gangguan aktivitas tersebut biasanya akan disertai dengan adanya gejala mental dan fisik. Jika tidak diatasi dengan segera maka akan menyebabkan gejala semakin parah. Depresi sendiri memiliki tingkatan tersendiri, yaitu depresi ringan, sedang hingga parah. Depresi ditandai dengan penurunan kecepatan berpikir, perubahan pola tidur dan selalu merasa gelisah.\",\"created_at\":\"2018-07-12 11:41:00\"},{\"idInformasi\":\"4\",\"namaPenyakit\":\"Gangguan Afektif\",\"content\":\"Seseorang yang mengalami gangguan mood atau afektif biasanya akan merasa sedih terus menerus, merasa gembira dalam periode tertentu,ataupun bisa sangat senang dan bisa sangat sedih namun fluktuatif. Gangguan ini merupakan bentuk paling umum dari ciri-ciri depresi ringan, ciri ciri bipolar disorder, ataupun gangguan kiklomitik yang mana perubahan mood terjadi secara siginifikan dan tanpa alasan jelas.\",\"created_at\":\"2018-07-12 11:41:35\"},{\"idInformasi\":\"5\",\"namaPenyakit\":\"Gangguan Jiwa Akibat Zat Psikoaktif\",\"content\":\"Zat psikoaktif memang memberikan pengaruh buruk bagi mental dan jiwa seseorang, sehingga tak heran jika zat psikoaktif dapapt menyebabkan gangguan mental dan jiwa. Yang termasuk ke dalam zat psikoaktif sendiri adalah obat-obat terlarang, minuman keras, dan narkoba.Ketika seseorang mengalami kecanduan, maka akan membuat mental dan pikirannya akan otomatis menjadi terganggu. Terutama jika orang tersebut mengkonsumsinya secara terus menerus dalam jangka waktu yang lama.\",\"created_at\":\"2018-07-12 11:42:34\"},{\"idInformasi\":\"6\",\"namaPenyakit\":\"Gangguan kepribadian\",\"content\":\"Gangguan kepribadian ini memiliki beberapa jenis, seperti paranoid personality disorder, gangguan identitas gender, gangguan kepribadian antisosial, dan masih banyak lainnya. Seseorang yang mengalami gangguan kepribadian pada umumnya memiliki karakter-karakter kaku dan ekstrem yang mana tidak sesuai pada kebiasaan masyarakat di lingkungannya.\",\"created_at\":\"2018-07-12 11:42:56\"}]},\"kurang_parameter\":[]}', '200', '2018-08-19 16:42:19', '[]'),
