ya akan disertai dengan adanya gejala mental dan fisik. Jika tidak diatasi dengan segera maka akan menyebabkan gejala semakin parah. Depresi sendiri memiliki tingkatan tersendiri, yaitu depresi ringan, sedang hingga parah. Depresi ditandai dengan penurunan kecepatan berpikir, perubahan pola tidur dan selalu merasa gelisah.\",\"created_at\":\"2018-07-12 11:41:00\"},{\"idInformasi\":\"4\",\"namaPenyakit\":\"Gangguan Afektif\",\"content\":\"Seseorang yang mengalami gangguan mood atau afektif biasanya akan merasa sedih terus menerus, merasa gembira dalam periode tertentu,ataupun bisa sangat senang dan bisa sangat sedih namun fluktuatif. Gangguan ini merupakan bentuk paling umum dari ciri-ciri depresi ringan, ciri ciri bipolar disorder, ataupun gangguan kiklomitik yang mana perubahan mood terjadi secara siginifikan dan tanpa alasan jelas.\",\"created_at\":\"2018-07-12 11:41:35\"},{\"idInformasi\":\"5\",\"namaPenyakit\":\"Gangguan Jiwa Akibat Zat Psikoaktif\",\"content\":\"Zat psikoaktif memang memberikan pengaruh buruk bagi mental dan jiwa seseorang, sehingga tak heran jika zat psikoaktif dapapt menyebabkan gangguan mental dan jiwa. Yang termasuk ke dalam zat psikoaktif sendiri adalah obat-obat terlarang, minuman keras, dan narkoba.Ketika seseorang mengalami kecanduan, maka akan membuat mental dan pikirannya akan otomatis menjadi terganggu. Terutama jika orang tersebut mengkonsumsinya secara terus menerus dalam jangka waktu yang lama.\",\"created_at\":\"2018-07-12 11:42:34\"},{\"idInformasi\":\"6\",\"namaPenyakit\":\"Gangguan kepribadian\",\"content\":\"Gangguan kepribadian ini memiliki beberapa jenis, seperti paranoid personality disorder, gangguan identitas gender, gangguan kepribadian antisosial, dan masih banyak lainnya. Seseorang yang mengalami gangguan kepribadian pada umumnya memiliki karakter-karakter kaku dan ekstrem yang mana tidak sesuai pada kebiasaan masyarakat di lingkungannya.\",\"created_at\":\"2018-07-12 11:42:56\"}]},\"kurang_parameter\":[]}', '200', '2018-08-19 18:41:14', '[]'),
